import { ACTIONS } from "./App"

//digit and dispatch are passed in on component creation as html attribute
export default function DigitButton({ dispatch, digit }){
    return(
        <button onClick={()=>
            dispatch({type:ACTIONS.ADD_DIGIT, payload:{digit}})}
        >
            {digit}
        </button>
    )
}
